#include <bits/stdc++.h>

using namespace std;

int sumFourDivisors(vector<int>& nums) {
    int totalSum = 0;

    for (int num : nums) {
        int cnt = 0;
        int sum = 0;

        for (int j = 1; j * j <= num; j++) {
            if (num % j == 0) {
                cnt++;
                sum += j;

                if (j != num / j) {
                    cnt++;
                    sum += num / j;
                }

                if (cnt > 4) break;
            }
        }

        if (cnt == 4) {
            totalSum += sum;
        }
    }

    return totalSum;
}


